column8:
ハリウッドセレブの乗る超高級車から軽自動車のエアロまで幅広く手がけ、世界中に多くの正規販売代理店を置く世界的エアロメーカーのヴァルド。そのヴァルドから小物類のブランドとして生まれたBlanBallen（ブランバレン）は、信頼性の確かな商品を続々発表中です。 <br>純正ﾋﾟﾗｰに貼り付けるリアルカーボンでサイドビューを引き締めます。特殊な加工を施されたリアルカーボンは、薄型設計、柔軟に車体へジャストフィットします。簡単装着により手軽にドレスアップが可能です。<br>生産国：日本　　　色：シルバーカーボン　　　構成：６ピース　　※写真に有りますアローエンブレムは付属いたしません。 <br>対応車種：170系 マジェスタ（H11/9-H16/6） <br>　<br>ボディパーツ/ドアパネル<tr><td colspan="2">
